import React from "react";
import axios from "axios";

export default function Test() {
  const abc = async () => {
    try {
      return await axios.get(
        "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
      );
    } catch (error) {
      console.error(error);
    }
  };

  const breeds = abc();
  alert(breeds.data.status);
}
